/* STYLES FOR THE WHOLE DOCUMENT */
*,
::after,
::before {
  font-size: 16px;
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  font-family: "DIN Pro Light", sans-serif;
}

/* VARIABLES */
:root {
  --dark-blue: #172335;
  --light-blue: #e9effe;
  --bright-blue: #a1cfeb;
  --white: #ffffff;
  --gray-blue: #c5cfe9;
  --shadow: #eceff3;
  --btn-brown-red: #a97060;
  --btn-purple: #7f60a9;
  --btn-green: #8ba960;
  --btn-pink: #d378c4;
  --btn-card-blue: #99bddd;
  --btn-card-purple: #9d1662;
  --btn-card-shadow-dark-blue: #172335;
  --btn-card-gray: #808080;
  --typing-animation-dot-color1: #78b6fd;
  --typing-animation-dot-color2: #172335;
  --typing-animation-dot-color3: #1723358f;
  --typing-animation-dot-color4: #172335;
  --modal-bckg-white: #ffffff;
  --modal-close-hover-pink: #e26f6f;
  --modal-quizz-hr-dark: #c5cfe900;
  --modal-form-check-blue: #c5cfe9;
  --modal-form-games-border-gray: #ccc;
  --chat-maximize-border-purple: #7f60a9;
  --aricoma-gold: #a98e5b;
}

/* STYLES FOR THE CHAT WINDOW */
.main-window {
  border-top: none;
  border-radius: 15px;
  transition: all 1s ease-out;
  visibility: visible;
  position: fixed;
  right: 2%;
  bottom: 1%;
  width: 24.875rem;
  height: 80%;
  max-height: 40.25rem;
  background-color: var(--white);
  border: 1px solid var(--dark-blue);
}

.header {
  width: 100%;
  height: 15%;
  min-height: 6.25rem;
  min-width: 24.75rem;
  background-color: var(--dark-blue);
  z-index: -1;
  border-radius: 15px 15px 0.75rem 0.75rem;
}

.img-logo {
  background-image: url(../img-avatars/HARALAMPIYE.png);
  background-size: cover;
  height: 7.5rem;
  width: 7.5rem;
  margin: 0.938rem 0 0 8.625rem;
  position: absolute;
  z-index: 1;
}

.chat-Name {
  position: absolute;
  margin: 0.9rem 0 0 9.375rem;
  color: var(--white);
  text-align: center;
  opacity: 0;
  word-wrap: break-word;
  width: 110px;
}

.chat-minimize {
  margin: 1.25rem 0 0 21.875rem;
  background-image: url(../img-avatars/minimize.svg);
  background-size: cover;
  position: absolute;
  width: 1.875rem;
  height: 1.875rem;
  background-color: var(--dark-blue);
  border: none;
}

.chat-maximize {
  position: fixed;
  bottom: 3.125rem;
  right: 3.125rem;
  background-image: url(../img-avatars/HARALAMPIYE.png);
  background-color: var(--dark-blue);
  background-size: cover;
  border-radius: 3.75rem;
  width: 6.25rem;
  height: 6.25rem;
  border: none;
  display: none;
}

#chatMaximize {
  transition: all 1s ease-in-out;
  border: 3px solid var(--aricoma-gold);
  opacity: 0;
  display: block;
  visibility: hidden;
  transform: translateY(-2200px);
}

.maximizeSpeechBox {
  width: 200px;
  height: 80px;
  margin: 50px auto;
  border-radius: 6px;
  padding: 5px;
  text-align: center;
  font-size: 0.9rem;
  color: var(--dark-blue);
  background-color: #ececec;
  position: fixed;
  word-wrap: break-word;
  display: flex;
  align-items: center;
  justify-content: center;
  right: 87.5px;
  bottom: 120px;
  box-shadow: 0.188rem 0.188rem 1rem rgb(71, 71, 71);
  display: none;
}

.speechBox:before {
  background-color: #ececec;
  content: "\00a0";
  height: 16px;
  position: absolute;
  top: 69px;
  right: 5px;
  transform: rotate(29deg) skew(-20deg);
  -moz-transform: rotate(29deg) skew(-20deg);
  -ms-transform: rotate(29deg) skew(-20deg);
  -o-transform: rotate(29deg) skew(-20deg);
  -webkit-transform: rotate(29deg) skew(-20deg);
  width: 20px;
  box-shadow: 0.28rem 0.05rem 1rem -1rem rgb(180, 180, 180);
}

.chat-window {
  width: 100%;
  height: 73%;
  border-radius: 1.563rem 1.563rem 0 0;
  background-color: var(--white);
  border-top: 0.375rem solid var(--bright-blue);
  margin-top: -7.5%;
  position: relative;
}

.twoRowBtnFlex {
  display: flex;
  flex-wrap: wrap;
  justify-content: space-evenly;
  padding: 3% 0 10% 0;
  height: 85%;
  width: 100%;
}

/* Media queries for chat window vertical responsiveness */

@media screen and (max-height: 789px) {
  .chat-window {
    height: 73%;
  }
}

@media screen and (max-height: 750px) {
  .chat-window {
    height: 72%;
  }
}

@media screen and (max-height: 711px) {
  .chat-window {
    height: 70%;
  }
}

@media screen and (max-height: 672px) {
  .chat-window {
    height: 68%;
  }
}

@media screen and (max-height: 633px) {
  .chat-window {
    height: 66%;
  }
}

@media screen and (max-height: 594px) {
  .chat-window {
    height: 64%;
  }
}

@media screen and (max-height: 555px) {
  .chat-window {
    height: 62%;
  }
}

@media screen and (max-height: 516px) {
  .chat-window {
    height: 60%;
  }
}

@media screen and (max-height: 477px) {
  .chat-window {
    height: 55%;
  }
}

@media screen and (max-height: 438px) {
  .chat-window {
    height: 50%;
  }
}

@media screen and (max-height: 399px) {
  .chat-window {
    height: 45%;
  }
}

@media screen and (max-height: 360px) {
  .chat-window {
    height: 40%;
  }
}

@media screen and (max-height: 359px) {
  .chat-window {
    height: 40%;
  }
  .main-window {
    height: 290px;
  }
}

.chat {
  overflow-y: auto;
  overflow-x: hidden;
  display: flex;
  flex-direction: column;
  width: 24.875rem;
  height: 100%;
}

.chat-history {
  margin-top: 2%;
  flex-direction: column;
  flex-wrap: wrap;
  padding-top: 1%;
}

.greetingMessage {
  margin-top: 10%;
  color: var(--dark-blue);
  font-family: "DIN Pro Bold", sans-serif;
  font-size: 1.2rem;
  text-align: center;
}

.greetingMessageQue {
  color: var(--dark-blue);
  margin-bottom: 1.563rem;
  text-align: center;
}

.chat-hr {
  background-color: var(--gray-blue);
  border-radius: 0.125rem;
  border: none;
}

.chat-js-hr {
  width: 1.875rem;
  background-color: var(--gray-blue);
  border-radius: 0.125rem;
  margin: 0 auto 0.938rem auto;
  padding: 0.094rem;
  border: none;
}

.errorWrapper {
  margin: auto;
  margin-top: 10%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}

.errorWrapper :first-child {
  width: 15rem;
}

.errorText {
  font-size: 1.5rem;
  padding-top: 5%;
  font-weight: bolder;
  text-align: center;
  color: #f84d4d;
}

/* STYLES FOR QUIZZES ICON */

.chat-quizzes {
  width: 5rem;
  height: 2.188rem;
  background-color: var(--dark-blue);
  position: absolute;
  margin: 0.8rem 0 0 17rem;
  border: none;
}

.chat-quizzes-icon {
  position: absolute;
  margin: 1.35rem 0 0 19.2rem;
  width: 2.75rem;
  height: 1.875rem;
  border: none;
  background: transparent;
}

/* STYLES FOR USER INPUT */

.chat-searchInput-div {
  background-color: var(--light-blue);
  bottom: 0;
  margin: 1.25rem 0.938rem;
  width: 22.875rem;
  height: 3.125rem;
  border-radius: 0.625rem;
  display: flex;
  align-items: center;
  justify-content: space-between;
}

#input {
  background-color: var(--light-blue);
  border: none;
  margin-top: 1rem;
  margin-left: 0.625rem;
  width: 18.75rem;
  height: 2.625rem;
  outline: none;
  color: var(--dark-blue);
}

#input:focus-within::placeholder {
  color: var(--dark-blue);
}

.chat-inputButton {
  display: none;
  background-image: url(../img-avatars/send.svg);
  background-size: cover;
  width: 1.563rem;
  height: 1.563rem;
  border: none;
  background-color: var(--light-blue);
  color: var(--dark-blue);
  margin-right: 0.625rem;
}

#voiceRecognitionLoader {
  display: none;
  width: 1rem;
  height: 1rem;
  border: none;
  padding-right: 2.7rem;
  padding-bottom: 2.1rem;
}

.voice-inputButton {
  display: block;
  background-image: url(../img-avatars/mic.svg);
}

#searchInput:focus-within {
  border: 0.063rem solid var(--dark-blue);
}

#searchInputWraper {
  height: 90px;
  border-radius: 0 0 1.563rem 1.563rem;
  background-color: var(--white);
  position: absolute;
  bottom: 0;
}

/* STYLES FOR THE BUTTONS */

.helper-div {
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 3%;
}

.mainButtonsStyle {
  width: 7.5rem;
  height: 3.125rem;
  border-radius: 0.625rem;
  border: none;
  box-shadow: 0.188rem 0.188rem 0.313rem var(--shadow);
  background-color: var(--white);
  margin: 0.313rem;
}
.chat-buttons-div {
  display: flex;
  flex-wrap: wrap;
  justify-content: space-evenly;
}

.chatBotBtns {
  height: 3rem;
  width: 8rem;
  min-width: 5rem;
  padding: 2%;
  border-radius: 0.313rem;
  border: none;
  border-top: 0.225rem solid var(--dark-blue);
  box-shadow: 0.188rem 0.188rem 0.313rem var(--shadow);
  background-color: var(--light-blue);
  color: var(--dark-blue);
  margin: 0.5rem;
  margin-top: 1rem;
}
.btnCard {
  width: 45%;
  height: 6rem;
  border: 1.5px solid var(--aricoma-gold);
  border-radius: 0.625rem;
  box-shadow: 0.188rem 0.188rem 0.313rem var(--shadow);
  background-color: var(--white);
  color: var(--dark-blue);
  margin-top: 5%;
  display: flex;
  flex-direction: column;
}

.btnCardName {
  color: var(--white);
  text-shadow: -0.5px -0.5px 0 var(--btn-card-shadow-dark-blue),
    0.5px -0.5px 0 var(--btn-card-shadow-dark-blue),
    -0.5px 0.5px 0 var(--btn-card-shadow-dark-blue),
    0.5px 0.5px 0 var(--btn-card-shadow-dark-blue);
  background-color: var(--aricoma-gold);
  font-weight: bold;
  padding: 0.5rem 0.8rem;
  font-size: 14.5px;
  text-align: left;
  float: left;
  width: 100%;
  border-radius: 0.625rem 0.625rem 0 0;
}

/* .gamesCardColor {
  background-color: var(--btn-card-purple);
} */

.btnCardDescription {
  color: var(--btn-card-gray);
  overflow-y: auto;
  font-size: 12px;
  padding: 0.5rem 0.8rem 0.2rem 0.8rem;
  width: 100%;
  text-align: left;
}

button:hover {
  cursor: pointer;
  transform: scale(1.08);
}

/* BELL STYLES */
.bell {
  display: block;
}

#waitingBellButton {
  padding-bottom: 2px;
  border: none;
  background: transparent;
}

.animateBell {
  -webkit-animation: ring 4s ease-in-out infinite;
  -webkit-transform-origin: 50% 4px;
  -moz-animation: ring 4s ease-in-out infinite;
  -moz-transform-origin: 50% 4px;
  animation: ring 4s ease-in-out infinite;
  transform-origin: 50% 4px;
}

/* CONTENT LOADER STYLES */

.lds-dual-ring {
  display: inline-block;
  width: 80px;
  height: 80px;
}
.lds-dual-ring:after {
  content: " ";
  display: block;
  width: 64px;
  height: 64px;
  margin: 8px;
  border-radius: 50%;
  border: 6px solid #fff;
  border-color: var(--dark-blue) transparent var(--dark-blue) transparent;
  animation: lds-dual-ring 1.2s linear infinite;
}

/* ANIMATIONS */

/* CONTENT LOADER ANIMATION */

@keyframes lds-dual-ring {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}

/* BELL ANIMATION */

